import React from 'react'
import styled from "styled-components";

const StyledBackground = styled.div`
width: 80%;
min-height: 400px;
border-radius: 10px;
background-color: lightgrey;
display: flex;
margin: auto;

`

export default function CardBackground() {
  return (
    <StyledBackground></StyledBackground>
  )
}
